column5:
Added callback triggers for chunk upload events.

// Callback for the start of each chunk upload request:
chunksend: function (e, data) {}, // .bind('fileuploadchunksend', func);

// Callback for successful chunk uploads:
chunkdone: function (e, data) {}, // .bind('fileuploadchunkdone', func);

// Callback for failed (abort or error) chunk uploads:
chunkfail: function (e, data) {}, // .bind('fileuploadchunkfail', func);

// Callback for completed (success, abort or error) chunk upload
requests:
chunkalways: function (e, data) {}, // .bind('fileuploadchunkalways',
func);

Added "previewdone" callback. Closes #2011.

The rendered preview element can be accessed the following way:

$('#fileupload').on('fileuploadpreviewdone', function (e, data) {
    console.log($(e.originalEvent.target).children());
});

Expose the chunk index and number of chunks. Fixes #1501.

Example code to set request headers based on the chunk index and chunks
number:

$('#fileupload').fileupload({
    maxChunkSize: 100000,
    beforeSend: function (jqXHR, settings) {
        if (settings.chunksNumber) {
            jqXHR.setRequestHeader('X-Chunk-Index',
settings.chunkIndex);
            jqXHR.setRequestHeader('X-Chunks-Number',
settings.chunksNumber);
        }
    }
});
